                {
                    output.Write(prop.Converter.ConvertToString(
                         prop.GetValue(item)));
                    output.Write("\t");
                }
                output.WriteLine();
            }
        }
    }

    public class ExportData
    {
        public string tabledata { get; set; }
        public string filename { get; set; }
    }
}